INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (142,'wium','<P><FONT size=5><STRONG>Talermandens BLOG</STRONG></FONT></P>\r\n<P>Her vil talermenden, når han engang finder ud af hvordan, udgyde sine mange erfaringer og livshistorier.</P>\r\n<P><STRONG>Mit liv i en kalender.</STRONG></P>\r\n<P>Først var der is-tiden. Dinosaurusser styrede verden og solen bestemte hvornår det var tid til at spise, sove og formere sig.</P>\r\n<P>Enhver var sin egen lykkes smed men kun den stærkeste overlevede. Så kom meteor regnen og intet var tilbage. Og dog ...</P>\r\n<P>Frem af amøbe sumpene kravlede nogle væsener der blev udsat for den skæbne ikke længere at være amorfe. Pludselig var der igen forskel på han og hun!</P>\r\n<P>Med tidernes skiften har hannerne langsomt men sikkert lært at der er noget der hedder spisetid. Vi har lært at der er noget der i det moderne samfund der hedder kvalitetstid, arbejdstid og onsdagstid!</P>\r\n<P>Med andre ord har vi underlagt os den rytme hunnerne har trukket ned over hovedet på os. Redskabet til at kunne sige fra har gennem årene udviklet sig fra en hårdtslåene trækølle til en sofistikeret time-manager.</P>\r\n<P>Med dette våben i hånden har vi nu muligheden for at sige fra igen&nbsp; (den gik tabt i 60-erne og 70-erne). Det er dog et tveægget sværd, får hunnerne først tilranet sig magt nok, til at kunne inføre diverse tidslommer i time-manageren, er man fortabt.</P>\r\n<P>En sådan han er jeg!</P>',4,0,12,0,'2008-03-23 09:22:58','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Talermanden','103');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (143,'wium','<P><FONT size=5><STRONG>Talermandens BLOG</STRONG></FONT></P>\r\n<P>Her vil talermenden, når han engang finder ud af hvordan, udgyde sine mange erfaringer og livshistorier.</P>\r\n<P><STRONG>Mit liv i en kalender.</STRONG></P>\r\n<P>Først var der is-tiden. Dinosaurusser styrede verden og solen bestemte hvornår det var tid til at spise, sove og formere sig.</P>\r\n<P>Enhver var sin egen lykkes smed men kun den stærkeste overlevede. Så kom meteor regnen og intet var tilbage. Og dog ...</P>\r\n<P>Frem af amøbe sumpene kravlede nogle væsener der led den skæbne ikke længere at være amorfe. Pludselig var der igen forskel på han og hun!</P>\r\n<P>Med tidernes skiften har hannerne langsomt men sikkert lært, at der er noget der hedder spisetid. Vi har lært, at der er noget der i det moderne samfund, der hedder kvalitetstid, arbejdstid og onsdagstid!</P>\r\n<P>Med andre ord har vi underlagt os den rytme hunnerne har trukket ned over hovedet på os. Redskabet til at kunne sige fra, har gennem årene udviklet sig fra en hårdtslåene trækølle til en sofistikeret time-manager.</P>\r\n<P>Med dette våben i hånden har vi nu muligheden for at sige fra igen&nbsp; (muligheden gik fuldstændig af fløjten&nbsp;i 60-erne og 70-erne). Det er dog et tveægget sværd: får hunnerne først tilranet sig magt nok, til at kunne indføre tidslommer i time-manageren, er man fortabt.</P>\r\n<P>En sådan han er jeg!</P>',5,0,12,0,'2008-03-23 09:25:37','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Talermanden','103');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (144,'wium','<P><FONT size=5><STRONG>Talermandens BLOG</STRONG></FONT></P>\r\n<P><STRONG>Mit liv i en kalender.</STRONG></P>\r\n<P>Først var der is-tiden. Dinosaurusser styrede verden og solen bestemte hvornår det var tid til at spise, sove og formere sig.</P>\r\n<P>Enhver var sin egen lykkes smed men kun den stærkeste overlevede. Så kom meteor regnen og intet var tilbage. Og dog ...</P>\r\n<P>Frem af amøbe sumpene kravlede nogle væsener der led den skæbne ikke længere at være amorfe. Pludselig var der igen forskel på han og hun!</P>\r\n<P>Med tidernes skiften har hannerne langsomt men sikkert lært, at der er noget der hedder spisetid. Vi har lært, at der er noget der i det moderne samfund, der hedder kvalitetstid, arbejdstid og onsdagstid!</P>\r\n<P>Med andre ord har vi underlagt os den rytme hunnerne har trukket ned over hovedet på os. Redskabet til at kunne sige fra, har gennem årene udviklet sig fra en hårdtslåene trækølle til en sofistikeret time-manager.</P>\r\n<P>Med dette våben i hånden har vi nu muligheden for at sige fra igen&nbsp; (muligheden gik fuldstændig af fløjten&nbsp;i 60-erne og 70-erne). Det er dog et tveægget sværd: får hunnerne først tilranet sig magt nok, til at kunne indføre tidslommer i time-manageren, er man fortabt.</P>\r\n<P>En sådan han er jeg!</P>',6,0,12,0,'2008-03-23 09:25:56','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Talermanden','103');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (145,'forside','<P><FONT size=5><STRONG>Forside</STRONG></FONT></P>\r\n<P><FONT size=2>Som minde om Hans, der døde i en tragisk bil-ulykke her til morgen (Søndag d. 30. marts 2008) vil der blive oprettet et billed galleri til ære for ham.</FONT></P>\r\n<P><FONT size=2>Har I nogle fotos der skal deles med andre der holdt af Hans, er i alle velkomne til at lægge billeder ind i galleriet.</FONT></P>\r\n<P><FONT size=2>Siden får sørgebind på i løbet af i dag og det vil være på siden til mindet om Hans i hele næste måned.</FONT></P>\r\n<P><FONT size=2>Ære være hans minde.</FONT></P>\r\n<P><FONT size=2>Webmaster</FONT></P>',7,0,6,0,'2008-03-30 13:23:32','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Forsiden','101');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (146,'wium','<P><FONT size=5><STRONG>Talermandens BLOG</STRONG></FONT></P>\r\n<P><STRONG>Min første blog.....</STRONG></P>\r\n<P>Kære alle.....her sidder jeg, og er ved at skrive min første BLOG, og det eneste som tonser rundt i mit hoved er....HVORFOR.....skulle det lige være vores ven, som denne gang ikke fik den chance han så inderligt havde fortjent.</P>\r\n<P>Mine tanker går rundt til mange mennesker lige nu, men nok mest til Ditte, børnene, Dorit og Svend Erik. Hvordan kan vi bedst støtte dem i denne periode, og skal jeg overhovedet gøre noget...eller vil det bare virke forkert at jeg gør noget....</P>\r\n<P>Jeg kan ikke bare sidde... ikke og gøre noget, så derfor tænkte jeg....hvad har jeg lyst til.....Hvordan kan jeg sende mine tanker til Ditte, børnene, Dorit og Svend Erik.</P>\r\n<P>Svaret blev blomster - med den latterlige korte tekst det er muligt at sende med...hvordan kan man beskrive sine tanker og medfølelse til en så tragisk situation...på bare 10 linier eller 230 karakterer....med Lene\'s hjælp lod det sig gøre.</P>\r\n<P>Vente....hvad sker der nu...hvordan har I det mon..hvordan tager Ole det her...hvad sker der mon nu med Ditte og børnene...fuck! fuck! fuck! Hvor er det bare ikke i orden det her.....det er så uvirkeligt!</P>\r\n<P>Michael har udvist stort mod, at informere os alle om denne tragiske ulykke. Tak for det Michael!</P>\r\n<P>Vi ses når vi ved hvornår vi kan tage afsked med Hans....beklager allesammen hvis ovenstående virker rodet....det er hvordan mit hoved ser ud indvendigt lige nu....var bare nødt til at få noget af det ud.</P>\r\n<P>Æret være Hans minde - for satan hvor vil jeg bare savne dig.....</P>\r\n<P>Talermanden</P>\r\n<P><STRONG></STRONG>&nbsp;</P>\r\n<P><STRONG>Mit liv i en kalender.</STRONG></P>\r\n<P>Først var der is-tiden. Dinosaurusser styrede verden og solen bestemte hvornår det var tid til at spise, sove og formere sig.</P>\r\n<P>Enhver var sin egen lykkes smed men kun den stærkeste overlevede. Så kom meteor regnen og intet var tilbage. Og dog ...</P>\r\n<P>Frem af amøbe sumpene kravlede nogle væsener der led den skæbne ikke længere at være amorfe. Pludselig var der igen forskel på han og hun!</P>\r\n<P>Med tidernes skiften har hannerne langsomt men sikkert lært, at der er noget der hedder spisetid. Vi har lært, at der er noget der i det moderne samfund, der hedder kvalitetstid, arbejdstid og onsdagstid!</P>\r\n<P>Med andre ord har vi underlagt os den rytme hunnerne har trukket ned over hovedet på os. Redskabet til at kunne sige fra, har gennem årene udviklet sig fra en hårdtslåene trækølle til en sofistikeret time-manager.</P>\r\n<P>Med dette våben i hånden har vi nu muligheden for at sige fra igen&nbsp; (muligheden gik fuldstændig af fløjten&nbsp;i 60-erne og 70-erne). Det er dog et tveægget sværd: får hunnerne først tilranet sig magt nok, til at kunne indføre tidslommer i time-manageren, er man fortabt.</P>\r\n<P>En sådan han er jeg!</P>',7,0,12,0,'2008-03-30 15:35:16','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Talermanden','103');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (147,'forside','<P><FONT size=5><STRONG>Forside</STRONG></FONT></P>\r\n<P><FONT size=2>Som minde om Hans, der døde i en tragisk bil-ulykke&nbsp;lørdagd. 29. marts 2008 vil der blive oprettet et billedgalleri til ære for ham.</FONT></P>\r\n<P><FONT size=2>Har I nogle fotos der skal deles med andre der holdt af Hans, er i alle velkomne til at lægge billeder ind i galleriet.</FONT></P>\r\n<P><FONT size=2>Siden får sørgebind på i løbet af i dag og det vil være på siden til mindet om Hans i hele næste måned.</FONT></P>\r\n<P><FONT size=2>Ære være hans minde.</FONT></P>\r\n<P><FONT size=2>Webmaster</FONT></P>',8,0,6,0,'2008-03-31 00:06:35','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Forsiden','101');
