INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (154,'historie','<P><FONT size=5><STRONG>Klanens historie</STRONG></FONT></P>\r\n<P><STRONG>På denne side fortælles klanens historie. En klan som vores har altid en sjov tilblivelses historie, men endnu sjovere er det at gå helt tilbage til dengang man mødte hinanden for første gang. Detektivarbjedet med at finde ud af hvem der introducerede hvem for hinanden er det ekstra krydderi der gør det hele til en unik odysse.</STRONG></P>\r\n<P><STRONG>Denne odysse tager udgangspunkt i forstæderne til København, Værløse og Ballerup.</STRONG></P>\r\n<P><STRONG>1973<BR>Mr. Red X åbenbares for verden og skummet spredes på humlen. Mesias er ankommet ... der er bare ingen der er klar over det, så jeg bliver taget med i benene og rykket ud ... også den gang vendte jeg forkert!<BR><BR>Der skal kun gå godt 10 år før genietmå oplære Chiliman udi fodboldens ædle kunstart, og således er kimen lagt til en af forbindelserne i klanen.</STRONG></P>\r\n<P>&nbsp;</P>',2,0,6,0,'2008-04-06 00:33:11','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Klanen','112');
