INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (164,'historie','<P><FONT size=5><STRONG>Klanens historie</STRONG></FONT></P>\r\n<P>På denne side fortælles klanens historie. En klan som vores har altid en sjov tilblivelses historie, men endnu sjovere er det at gå helt tilbage til dengang man mødte hinanden for første gang. Detektivarbjedet med at finde ud af hvem der introducerede hvem for hinanden er det ekstra krydderi der gør det hele til en unik odysse.</P>\r\n<P>Denne odysse tager udgangspunkt i forstæderne til København, Værløse og Ballerup.</P>\r\n<P><STRONG>1972</STRONG></P>\r\n<P>1972 er stort år&nbsp;i Danmarks og Ballerups historie i det Radionetledningssnitteren, Talermanden og Søstertyven kommer til verdenen. Samtidig fødes en obsternassig møgunge i Rødovre, som på dette tidspunkt har en terroriserende storesøster på næsten tre år.</P>\r\n<P><STRONG>1973</STRONG><BR>Mr. Red X åbenbares for verden og skummet spredes på humlen. Mesias er ankommet ... der er bare ingen der er klar over det, så jeg bliver taget i benene og rykket ud ... også dengang vendte jeg forkert!<BR><BR><STRONG>1984<BR></STRONG>Der skal kun gå godt 11 år før Mr. Red X må oplære klassekammeraten Chiliman udi fodboldens ædle kunstart og således er kimen lagt til et langt venskab og en af forbindelserne i klanen.<BR>På grønsværen dukker Den Trætte Mand, Radioledningesnitter og Børneopdrættreren op i Mr. Red X univers. De har meget at lære :) og mange fodboldkampe og&nbsp;fester har siden lagt kimen til endnu tre forbindelser i klanen.</P>\r\n<P><STRONG>2008<BR></STRONG>Klanen mister et elsket og durebart medlem, Hans.<BR>Junior optages ... ritualet afventer stadig :D</P>',12,0,6,0,'2008-04-18 19:43:33','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Klanen','112');
