INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (172,'historie','<P><FONT size=5><STRONG>Klanens historie</STRONG></FONT></P>\r\n<P>På denne side fortælles klanens historie. En klan som vores har altid en sjov tilblivelses historie, men endnu sjovere er det at gå helt tilbage til dengang man mødte hinanden for første gang. Detektivarbjedet med at finde ud af hvem der introducerede hvem for hinanden er det ekstra krydderi der gør det hele til en unik odysse.</P>\r\n<P>Denne odysse tager udgangspunkt i forstæderne til København, Værløse og Ballerup.</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><FONT face=Tahoma><STRONG><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\">1972</SPAN></STRONG><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></FONT></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\">1972 er stort år i Klanens, Danmarks og Ballerups historie idet Radionetledningssnitteren, Talermanden og Søstertyven kommer til verdenen. Samtidig fødes en obsternassig møgunge i Rødovre, som på dette tidspunkt har en terroriserende storesøster på næsten tre år.</SPAN></P>\r\n<P><STRONG>1973</STRONG><BR>Mr. Red X åbenbares for verden og skummet spredes på humlen. Mesias er ankommet ... der er bare ingen der er klar over det, så jeg bliver taget i benene og rykket ud ... også dengang vendte jeg forkert!<BR><BR><STRONG>1984<BR></STRONG>Der skal kun gå godt 11 år før Mr. Red X må oplære klassekammeraten Chiliman udi fodboldens ædle kunstart og således er kimen lagt til et langt venskab og en af forbindelserne i klanen.<BR>På grønsværen dukker Den Trætte Mand, Radioledningesnitter og Børneopdrættreren op i Mr. Red X univers. De har meget at lære :) og mange fodboldkampe og&nbsp;fester har siden lagt kimen til endnu tre forbindelser i klanen.</P><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 11.0pt\">\r\n<P style=\"MARGIN: 0cm 0cm 0pt\"><STRONG><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt\">1985</SPAN></STRONG><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt\">&nbsp;<o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 11.0pt\">nedlægges Radionetledningssnitterens klasse på Hedegårdsskolen. Den arme snitter kommer i klasse med Søstertyven. Talermanden, som allerede er ven med Radionetledningssnitteren, og Søstertyven introduceres. Dette fejres med Talermandens fars hjemmelavede rødvin..eller noget der ligner..Tømmermændene og venskabet vil ingen ende tage.</SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 11.0pt\"></SPAN>&nbsp;</P><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 11.0pt\"><FONT size=3>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\"><STRONG>1988<o:p></o:p></STRONG></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\">Talermanden spilder øl på Søstertyvens pizza….Her 20 år efter har han stadig ikke sagt undskyld…..</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\"></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\"><STRONG>1992</STRONG></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\">Klanens første sommerferietur ser dagens lys. Til Bornholm med EM-sejr og 13 kasser øl. Sommerferien kan begynde for Talermanden, Radionetledningssnitteren, Hundetæmmeren, Den Trætte Mand og Søstertyven.</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\"></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\"><STRONG>1993</STRONG></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\">gentages successen og Landmanden, som Den Trætte Mand har lært at kende på Svagstrømsskolen,&nbsp;er med til Espana. Med sit SU-budget må Landmanden dog&nbsp;drikke pool-vand i stedet for San Miguel....Talermanden skal til vinsmagning i København og har derfor ikke plads i kalender til sommerferie sydpå.</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\"></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA; mso-bidi-font-size: 12.0pt\"></SPAN></FONT></SPAN></SPAN><STRONG>2008<BR></STRONG>Klanen mister et elsket og durebart medlem, Hans.<BR>Junior optages ... ritualet afventer stadig :D</P>',20,0,6,0,'2008-04-18 20:16:38','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Klanen','112');
