på Hedegårdsskolen. Den arme snitter kommer i klasse med Søstertyven. Talermanden, som allerede er ven med Radionetledningssnitteren, og Søstertyven introduceres. Dette fejres med Talermandens fars hjemmelavede rødvin..eller noget der ligner..Tømmermændene og venskabet vil ingen ende tage.</SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN>&nbsp;</P><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\"><STRONG>1988<o:p></o:p></STRONG></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">Talermanden spilder øl på Søstertyvens pizza….Her 20 år efter har han stadig ikke sagt undskyld…..</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><STRONG>1992</STRONG></S