 mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><STRONG></STRONG></SPAN></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">Den største fejl i klanens historie sker en lørdag aften, i dette herrens&nbsp;år, den obsternassig møgunge (hundetæmmeren) er i byen med søstertyven og sin søster, sikke noget svineri !</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">bryllup og to børn kom der ud af det. Undskyld allesammen&nbsp;:( </SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\">&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN></FONT></SPAN></SPAN><STRONG>2008<BR></STRONG>Klanen mister et elsket og dyrebart medlem, Hans.<BR>Junior optages ... ritualet afventer stadig :D</P>',28,0,6,0,'2008-06-23 22:14:01','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Klanen','112');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (182,'skitur','<P><FONT size=5><STRONG>SKITUR 2009</STRONG></FONT></P>\r\n<P>Skitruen gå i år til Trysil i Norge!<BR></P>\r\n<TABLE cellSpacing=0 cellPadding=0 width=\"100%\" border=0>\r\n<TBODY>\r\n<TR vAlign=top align=left>\r\n<TD colSpan=6>\r\n<TABLE cellSpacing=0 cellPadding=0 width=\"100%\" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD noWrap>\r\n<P><STRONG>Trysil Turistsenter | Skitorget</STRONG> </P></TD>\r\n<TD vAlign=top align=left width=10><IMG height=10 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=10> </TD>\r\n<TD width=\"100%\"></TD>\r\n<TD noWrap><IMG height=16 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=17 border=0> <IMG height=10 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=9> <IMG src=\"https://www.skistar.com/app/projects/common/images/system/boende/icon_large_cigarette.gif\" border=0> </TD></TR>\r\n<TR>\r\n<TD class=svart11pt colSpan=4>Leilighet, 63 m², 2 soverom, 6 senger, 1 bad, byggeår 1990/2006. Sengekombinasjon (D)+(K+K)Forklaring på sengekombinasjon: D = dobbeltseng, E = enkeltseng, K = køyeseng, KB = køyeseng med bred underkøye (tallet bak KB angir bredden på underkøyen)Bad 1 med dusj, WC og badstu. Enheten har oppvaskmaskin, mikrobølgeovn, kjøleskap l, fryser l. Denne leiligheten formidles på vegne av Trysil ResortRøyking ikke tillatt </TD></TR></TBODY></TABLE></TD>\r\n<TD>&nbsp;</TD>\r\n<TD vAlign=bottom align=right>\r\n<TABLE cellSpacing=0 cellPadding=0 border=0>\r\n<TBODY>\r\n<TR vAlign=top align=left>\r\n<TD bgColor=#99cce6 colSpan=3><IMG height=1 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=16></TD></TR>\r\n<TR vAlign=top align=left>\r\n<TD width=1 bgColor=#99cce6><IMG height=15 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=1></TD>\r\n<TD>\r\n<TABLE cellSpacing=0 cellPadding=0 border=0>\r\n<TBODY>\r\n<TR vAlign=top align=left bgColor=#ffffff>\r\n<TD colSpan=3><IMG height=1 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=16></TD></TR>\r\n<TR vAlign=top align=left>\r\n<TD width=1 bgColor=#ffffff><IMG height=15 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=1></TD>\r\n<TD>\r\n<TABLE cellSpacing=0 cellPadding=0 border=0>\r\n<TBODY>\r\n<TR>\r\n<TD>\r\n<TABLE cellSpacing=0 cellPadding=0 border=0>\r\n<TBODY>\r\n<TR>\r\n<TD bgColor=#ffffff><A href=\"javascript: showMoreImages(\'TTUST01\',\'pool\',22866);\"><IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=22866&amp;x=160\" border=0></A></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE><IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=22866&amp;y=300\"> <IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=14447&amp;y=300\"> <IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=14443&amp;y=300\"> <IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=14444&amp;y=300\"> \r\n<P><FONT size=5><STRONG></STRONG></FONT>&nbsp;</P>\r\n<P><FONT size=5><STRONG>SKITUR 2008</STRONG></FONT></P>\r\n<P><FONT size=2>Turen gik i år til Norge. Hemsedal for at være helt præcis. Vi havde lånt en Ford transit af Claus, som var årets \"nye\" mand, så vi kunne køre samlet i et køretøj. Det var super hyggeligt. 4 så film imens driver og co-driver ordende kørslen.</FONT></P>\r\n<P><FONT size=2>Hytten var af luksusklassen og plads var der rigeligt af. 5 soveværelser til 6 mand giver hygge for to ;)</FONT></P>\r\n<P><FONT size=2>Pistene var lidt længere væk end vi havde regnet med, men det gjorde ikke det store, for kvaliteten af pisterne kompenserede mere end rigeligt for den ekstra køretid - det var super fedt terræn, både on og off piste. <BR>Jeg vil gerne i den anledning sende de varmeste hilsener til bo, som viste os flere sider af den skønne Norske natur end vi havde kunnet ønske os. (Eller frygte vil nogen nok mene!) Claus takker for de trykkede ribben!</FONT></P>\r\n<P><FONT size=2>Se flere billeder under [billeder] og vælg galleriet [Skitur 2008]</FONT></P>\r\n<P>&nbsp;<IMG height=98 alt=Hytte hspace=0 src=\"http://www.traekmigikaelken.dk/upload/uploads/image006.jpg\" width=118 align=baseline border=0>&nbsp;<IMG style=\"WIDTH: 134px; HEIGHT: 109px\" height=99 alt=Grundplan hspace=0 src=\"http://www.traekmigikaelken.dk/upload/uploads/image008.jpg\" width=128 align=baseline border=0>&nbsp;<IMG height=99 alt=Sofagruppen hspace=0 src=\"http://www.traekmigikaelken.dk/upload/uploads/image009.jpg\" width=129 align=baseline border=0>&nbsp;<IMG height=98 alt=Køkken hspace=0 src=\"http://www.traekmigikaelken.dk/upload/uploads/image012.jpg\" width=118 align=baseline border=0></P></FONT>\r\n<P><STRONG><FONT size=5>SKITUR 2007</FONT></STRONG></P>\r\n<P>Turen var et Kæmpe hit. Ikke mindst fordi vi fik Pizza TorTur til daglig ;)</P>\r\n<P><FONT size=3><STRONG>SÅ ER DER VIDEO FRA TUREN<BR></STRONG></FONT><FONT size=2><A href=\"http://www.traekmigikaelken.dk/upload/uploads/klan2007_0001.wmv\">Hent den her</A></FONT></P>\r\n<P><STRONG><FONT size=3>Sälen greatest 2007 05<BR></FONT></STRONG><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Rasmus%20Nøhr%20ft.%20Ida%20Corr%20-%20Det%20Glade%20Pizzabud.mp3\">Rasmus Nøhr ft. Ida Corr - Det Glade Pizzabud</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Karina%20Kappel%20Remix%20Twisted%20Cinderella.mp3\">Karina Kappel Remix - Twisted Cinderella</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/ACDC%20-%20You%20Shook%20Me%20Up%20All%20Night%20Long.mp3\">ACDC - You Shook Me Up All Night Long</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/ACDC,Bon%20Jovi,Metallica,Nirvana,Guns%20And%20Roses%20-%20She%20Shook%20Me%20All%20Night%20Long.mp3\">ACDC,Bon Jovi,Metallica,Nirvana,Guns And Roses - She Shook Me All Night Long</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Ufo%20og%20Yepha%20-%20Op%20med%20håret.mp3\">Ufo og Yepha - Op med håret</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Ufo%20Yepa%20Bli%20Glad%20&amp;%20Natasja%20-%20Hængekøjen%20remix.mp3\">UFO &amp; Yepha Feat. Bli\' Glad &amp; Natasja - Hængekøjen remix</A></P>\r\n<TABLE width=\"100%\" border=0>\r\n<TBODY>\r\n<TR>\r\n<TD align=middle width=\"50%\">\r\n<P>SÄLEN INFO</P>\r\n<P>Nyttige links: <BR><A href=\"http://www.skistar.com/salen/svenska/skidakning/pistkartor/index.app\">Pistekort</A><BR><A href=\"http://www.skistar.com/salen/svenska/skidakning/oppna_pister__liftar/index.app\">Piste info</A></P></TD>\r\n<TD>\r\n<P align=right><IMG alt=\"\" hspace=0 src=\"http://www.traekmigikaelken.dk/upload/uploads/skibake%201.jpg\" align=baseline border=0></P></TD></TR></TBODY></TABLE>\r\n<P>&nbsp;</P>\r\n<P>Sådan så hytten ud ... inden vi havde trashet den! (klik for store billeder)</P>\r\n<P>&nbsp;<A href=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_01.jpg\"><IMG alt=Hytten hspace=10 src=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_01.jpg\" width=100 align=baseline border=0></A><A href=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_02.jpg\"><IMG alt=\"\" hspace=10 src=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_02.jpg\" width=100 align=baseline border=0></A><A href=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_03.jpg\"><IMG alt=\"\" hspace=10 src=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_03.jpg\" width=100 align=baseline border=0></A></P>\r\n<P>&nbsp;</P>',23,0,6,0,'2008-09-15 10:03:53','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Skitur','104');
