INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (206,'rynkeby','\r\n<P><FONT size=5><STRONG>Historien om en entusiast<BR></STRONG><FONT \r\nsize=3>&nbsp;</FONT><BR></FONT></P>\r\n<P><FONT size=5>Yes sir! Så er grejet ankommet. </FONT></P>\r\n<P><FONT size=5>&nbsp;<IMG style=\"WIDTH: 439px; HEIGHT: 328px\" height=1380 \r\nalt=\"Cykel samlet\" hspace=0 \r\nsrc=\"http://www.traekmigikaelken.dk/upload/uploads/Rynke1.JPG\" width=1744 \r\nalign=baseline border=0></FONT></P>\r\n<P><FONT size=5>Bemærk sadlen... ikke ligefrem mormor modelen. Det \r\nkommer&nbsp;til at gøre mega nas i ******</FONT></P>\r\n<P><FONT size=5>Her er ruten, hvis der er en som mangler et tur \r\nforslag</FONT></P>\r\n<P><FONT size=5><IMG style=\"WIDTH: 464px; HEIGHT: 283px\" height=221 alt=\"\" \r\nhspace=0 \r\nsrc=\"http://www.traekmigikaelken.dk/upload/uploads/TeamRynkeby-Rute.bmp\" \r\nwidth=327 align=baseline border=0></FONT></P>\r\n<P><FONT size=5>Trænings log:</FONT></P>\r\n<P><FONT size=3>Søndag d. 22/2&nbsp; 2x30 min. Av min røv</FONT></P>\r\n<P><FONT size=3>Mandag d. 23/2 1 time. Røven sagde av de første 20 min. Højre \r\nfod lidt øm.</FONT></P>\r\n<P><FONT size=3>Onsdag d. 25/2 1½ time. Røven sagde av de første 5 min. \r\n</FONT></P>\r\n<P><FONT size=3>Torsdag d. 26/2 1½ time. Røven ok, højre fod sov lidt, svedte \r\nsom et svin.</FONT></P>\r\n<P><FONT size=3>Søndag d. 1/3 30km. Røven ok, fod ok. Rimlig hårdt oven på druk \r\nweekend :-(</FONT></P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size=3>\r\n<TABLE style=\"WIDTH: 879pt; BORDER-COLLAPSE: collapse\" cellSpacing=0 \r\ncellPadding=0 width=1171 border=0>\r\n<COLGROUP>\r\n<COL style=\"WIDTH: 48pt\" span=2 width=64>\r\n<COL style=\"WIDTH: 61pt; mso-width-source: userset; mso-width-alt: 2962\" \r\nwidth=81>\r\n<COL style=\"WIDTH: 56pt; mso-width-source: userset; mso-width-alt: 2742\" \r\nwidth=75>\r\n<COL style=\"WIDTH