INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (209,'rynkeby','<P><FONT size=5><STRONG>Historien om en entusiast<BR></STRONG><FONT size=3>&nbsp;</FONT><BR></FONT></P>\r\n<P><FONT size=5>Yes sir! Så er grejet ankommet. </FONT></P>\r\n<P><FONT size=5>&nbsp;<IMG style=\"WIDTH: 439px; HEIGHT: 328px\" border=0 hspace=0 alt=\"Cykel samlet\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/Rynke1.JPG\" width=1744 height=1380></FONT></P>\r\n<P><FONT size=5>Bemærk sadlen... ikke ligefrem mormor modelen. Det kommer&nbsp;til at gøre mega nas i ******</FONT></P>\r\n<P><FONT size=5>Her er ruten, hvis der er en som mangler et tur forslag</FONT></P>\r\n<P><FONT size=5><IMG style=\"WIDTH: 464px; HEIGHT: 283px\" border=0 hspace=0 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/TeamRynkeby-Rute.bmp\" width=327 height=221></FONT></P>\r\n<P><FONT size=5>Trænings plan fra en MEGET optimistisk hold kaptajn:</FONT></P>\r\n<P><IMG style=\"WIDTH: 658px; HEIGHT: 612px\" border=0 hspace=0 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/TRV%20trænings%20plan.JPG\" width=692 height=666></P>\r\n<P><FONT size=5></FONT>&nbsp;</P>\r\n<P><FONT size=5>Trænings log:</FONT></P>\r\n<P><FONT size=3>Søndag d. 22/2&nbsp; 2x30 min. Av min røv</FONT></P>\r\n<P><FONT size=3>Mandag d. 23/2 1 time. Røven sagde av de første 20 min. Højre fod lidt øm.</FONT></P>\r\n<P><FONT size=3>Onsdag d. 25/2 1½ time. Røven sagde av de første 5 min. </FONT></P>\r\n<P><FONT size=3>Torsdag d. 26/2 1½ time. Røven ok, højre fod sov lidt, svedte som et svin.</FONT></P>\r\n<P><FONT size=3>Søndag d. 1/3 30km. Røven ok, fod ok. Rimlig hårdt oven på druk weekend :-(</FONT></P>\r\n<P><FONT size=3>Tirsdag d. 3/3 43km. 1t&amp;50 min.Fælles træning. Væltede efter ca. 30m lol. Lorte bakker.</FONT></P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size