'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><A href=\"http://www.gmap-pedometer.com/?r=2679318\" target=_blank><SPAN style=\"COLOR: #0068cf\"><U>http://www.gmap-pedometer.com/?r=2679318</U></SPAN></A>. <FONT size=3>Kørte lidt extra så jeg rundede de 100 km</FONT>. </SPAN></FONT></P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>',35,0,7,0,'2009-04-10 14:49:15','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Rynkeby','106');
