-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\" class=xl78 align=right x:num=\"40008\"><FONT size=3 face=Calibri>14.7.09</FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\"><FONT size=3 face=Calibri>Tir</FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\" class=xl65 align=right x:num=\"0.70833333333333337\"><FONT size=3 face=Calibri>17:00</FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\"><FONT size=3 face=Calibri>Nordvest KBH (fx Mosehuset, start motorvej 16)</FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\" align=right x:num><FONT size=3 face=Calibri>30</FONT></TD></TR>\r\n<TR style=\"HEIGHT: 15.75pt\" height=21>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; HEIGHT: 15.75pt; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\" class=xl64 height=21><FONT size=3 face=Calibri></FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\" class=xl78><FONT size=3 face=Calibri></FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\"><FONT size=3 face=Calibri></FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\"><FONT size=3 face=Calibri></FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: #f0f0f0; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: #f0f0f0; BORDER-RIGHT: #f0f0f0\"><FONT size=3 face=Calibri></FONT></TD>\r\n<TD style=\"BORDER-BOTTOM: windowtext 2pt double; BORDER-LEFT: #f0f0f0; BACKGROUND-COLOR: transparent; BORDER-TOP: windowtext 0.5pt solid; BORDER-RIGHT: #f0f0f0\" class=xl77 align=right x:num=\"3217\" x:fmla=\"=SUM(F2:F41)\"><STRONG><FONT face=Arial>3.217</FONT></STRONG></TD></TR></TBODY></TABLE></P>\r\n<P>Trænings log:</P>\r\n<P></FONT><FONT size=3>Total km:&nbsp;1202&nbsp;&nbsp; Total tid: 49:19</FONT></P>\r\n<P><FONT size=3>Søndag d. 22/2&nbsp; 2x30 min. Av min røv</FONT></P>\r\n<P><FONT size=3>Mandag d. 23/2 1 time. Røven sagde av de første 20 min. Højre fod lidt øm.</FONT></P>\r\n<P><FONT size=3>Onsdag d. 25/2 1½ time. Røven sagde av de første 5 min. </FONT></P>\r\n<P><FONT size=3>Torsdag d. 26/2 1½ time. Røven ok, højre fod sov lidt, svedte som et svin.</FONT></P>\r\n<P><FONT size=3>Søndag d. 1/3 30km. Røven ok, fod ok. Rimlig hårdt oven på druk weekend :-(</FONT></P>\r\n<P><FONT size=3>Tirsdag d. 3/3 43km. 1t&amp;50 min. Fælles træning. Væltede efter ca. 30m lol. Lorte bakker.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 7/3 41km. 1t&amp;41 min. Fælles træning. Ok tur, koldt langs strandvejen.</FONT></P>\r\n<P><FONT size=3>Tirsdag&nbsp;d. 10/3 1½ time. Rimlig trist at træne indendørs :-(</FONT></P>\r\n<P><FONT size=3>Lørdag d. 14/3 52km 2t&amp;16 min træning. God tur, lidt øm i lænden/ballerne.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 21/3 65km 2t41 min. Fælles træning. Rigtig god tur, overskud til slutspurt :-)</FONT></P>\r\n<P><FONT size=3>Søndag d. 29/3 80km 3t&amp;27 min. Fælles træning, Ok tur, trist gennem KBH, godt ved Hvidovre og Amager. Kræfter til spurt.</FONT></P>\r\n<P><FONT size=3>Tirsdag d. 31/3 53km 2t03 min. Fælles træning, ok tur, kunne godt mærke søndagens tur i benene.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 4/4 75km 2t52 min. Fælles træning. Ok tur. Havde lidt ondt i højre knæ i starten.</FONT></P>\r\n<P><FONT size=3>Fredag d. 10/4 100,6 km 3t57min. Fælles træning. Rigtig god tur, se bare her: <SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><A href=\"http://www.gmap-pedometer.com/?r=2679318\" target=_blank><SPAN style=\"COLOR: #0068cf\"><U>http://www.gmap-pedometer.com/?r=2679318</U></SPAN></A>. <FONT size=3>Kørte lidt extra så jeg rundede de 100 km</FONT>. </SPAN></FONT></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d.12/4 93km 3t40min. Fælles træning i Korsør. Lidt ondt i røv, men ellers ok tur.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>En lille pause periode grundet knæskade. MR scanning siger minisk skade. Ved kikkert operation er der heldigvis kun små bruskskader. Må gerne cykle igen.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Fredag d. 8/5 40km 1t10min træning med Steen&nbsp;i Roskilde området. Første længere tur efter knæ operationen. Fin tur, temmelig meget mod vind.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Lørdag d. 9/5 25km 1t træning allene i Ballerup. Skulle lige ud og se om knæeet holdt. Det gjorde det.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d. 10/5 63km 2t28min træning med Wium. God tur til Klampenborg, Nærum, Farum og hjem.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Tirsdag d. 12/5 70km træning med TRV holdet. Rigtig god tur.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Torsdag d. 14/5 50km træning med nogle fra TRV holdet i Roskilde omegen.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d. 17/5 145km Skjoldnæsholmløbet. Rigtig god tur fra Roskilde og vest på. Er pænt træt i hele kroppen og vil bare gerne i seng og sove...</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d. 24/5. 110km køretid 4t41min totaltid 7,5time. Regnvejrs tur, 15 punkteringer alt i alt. Pænt trist.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Verdana\',\'sans-serif\'; FONT-SIZE: 10pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Tirsdag d. 26/5. 71km. Fed tur fra Albertslund mod Hove, Ganløse og videre. Hjem via Trekroner...</FONT></SPAN></P>\r\n<P><FONT size=3>Lørdag d. 30/5 120km. Tur rundt i på Møn fra Langebæk</FONT></P>\r\n<P><FONT size=3>Lørdag d. 6/6 100km. Søsletteløbet fra Ringe på Fyn. </FONT></P>\r\n<P><FONT size=3>Søndag d. 7/6 70km på Hallandsåsen i Sverige. De har bakker der vil noget :-)</FONT></P>\r\n<P><FONT size=3>Søndag d. 14/6 185km.&nbsp;Lige over 7 timer. Vordingborg&nbsp;-&gt; Præstø -&gt; Stege -&gt; Vordingborg. Lang tur, men go træning.</FONT></P>\r\n<P><FONT size=3>Søndag d. 21/6 160km. Tur til sommerhus i Sverige. Stille og rolig tur grundet de mange pauser</FONT></P>\r\n<P><FONT size=3>Mandag d. 22/6 75km. Fin tur med start fra Albertslund. Kun 13 deltagere... sikkert på grund af trænings turen søndag.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 27/6 200km. YES !!! Det lykkedes at runde 200km på 1 dag. Totalt optur...</FONT></P>\r\n<P><FONT size=3>Søndag d. 28/6 160km. Stille og rolig tur oven på de 200 km i går. Ingen problemer med røv eller føder.</FONT></P>\r\n<P><FONT size=3>Tirsdag d. 14/7.... Forventer jeg at køre 75km. Sidste trænngs samling før det går mod Paris d. 17...</FONT></P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>',43,0,7,0,'2009-07-03 16:04:39','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Rynkeby','106');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (234,'historie','<P><FONT size=5><STRONG>Klanens historie</STRONG></FONT></P>\r\n<P>På denne side fortælles klanens historie. En klan som vores har altid en sjov tilblivelses historie, men endnu sjovere er det at gå helt tilbage til dengang man mødte hinanden for første gang. Detektivarbjedet med at finde ud af hvem der introducerede hvem for hinanden er det ekstra krydderi der gør det hele til en unik odysse.</P>\r\n<P>Denne odysse tager udgangspunkt i forstæderne til København, Værløse og Ballerup.</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><FONT face=Tahoma><STRONG><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\">1972</SPAN></STRONG><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></FONT></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">1972 er stort år i Klanens, Danmarks og Ballerups historie idet Radionetledningssnitteren, Talermanden og Søstertyven kommer til verdenen. Samtidig fødes en obsternassig møgunge i Rødovre, som på dette tidspunkt har en terroriserende storesøster på næsten tre år.</SPAN></P>\r\n<P><STRONG>1973</STRONG><BR>Mr. Red X åbenbares for verden og skummet spredes på humlen. Mesias er ankommet ... der er bare ingen der er klar over det, så jeg bliver taget i benene og rykket ud ... også dengang vendte jeg forkert!</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><STRONG><SPAN style=\"FONT-SIZE: 9pt; COLOR: black; FONT-FAMILY: Verdana\">1981</SPAN></STRONG><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\"><o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 9pt; FONT-FAMILY: Verdana; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">Børneopdrætteren bliver far for første gang….Hvad sker der for jer!!!!!</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 9pt; FONT-FAMILY: Verdana; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN><BR><STRONG>1984<BR></STRONG>Der skal kun gå godt 11 år før Mr. Red X må oplære klassekammeraten Chiliman udi fodboldens ædle kunstart og således er kimen lagt til et langt venskab og en af forbindelserne i klanen.<BR>På grønsværen dukker Den Trætte Mand, Radioledningesnitter og Børneopdrættreren op i Mr. Red X univers. De har meget at lære :) og mange fodboldkampe og&nbsp;fester har siden lagt kimen til endnu tre forbindelser i klanen.</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\">&nbsp;</P><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">\r\n<P style=\"MARGIN: 0cm 0cm 0pt\"><STRONG><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt\">1985</SPAN></STRONG><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt\">&nbsp;<o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">nedlægges Radionetledningssnitterens klasse på Hedegårdsskolen. Den arme snitter kommer i klasse med Søstertyven. Talermanden, som allerede er ven med Radionetledningssnitteren, og Søstertyven introduceres. Dette fejres med Talermandens fars hjemmelavede rødvin..eller noget der ligner..Tømmermændene og venskabet vil ingen ende tage.</SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN>&nbsp;</P><SPAN style=\"FONT-SIZE: 10pt; COLOR: black; FONT-FAMILY: Tahoma; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; mso-bidi-font-size: 12.0pt\"><STRONG>1988<o:p></o:p></STRONG></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">Talermanden spilder øl på Søstertyvens pizza….Her 21 år efter har han stadig ikke sagt undskyld…..</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><STRONG>1992</STRONG></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">Klanens første sommerferietur ser dagens lys. Til Bornholm med EM-sejr og 13 kasser øl. Sommerferien kan begynde for Talermanden, Radionetledningssnitteren, Hundetæmmeren, Den Trætte Mand og Søstertyven.</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><STRONG>1993</STRONG></SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">gentages successen og Landmanden, som Den Trætte Mand har lært at kende på Svagstrømsskolen,&nbsp;er med til Espana. Med sit SU-budget må Landmanden dog&nbsp;drikke pool-vand i stedet for San Miguel\'er....Talermanden skal til vinsmagning i København og har derfor ikke plads i sin kalender til sommerferie sydpå.</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><STRONG></STRONG></SPAN></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">Den største fejl i klanens historie sker en lørdag aften, i dette herrens&nbsp;år, den obsternassig møgunge (hundetæmmeren) er i byen med søstertyven og sin søster, sikke noget svineri !</SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\">bryllup og to børn kom der ud af det. Undskyld allesammen&nbsp;:( </SPAN></P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\">&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN></FONT></SPAN></SPAN><STRONG>2008<BR></STRONG>Klanen mister et elsket og dyrebart medlem, Hans.<BR>Junior optages ... ritualet afventer stadig :D</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\">&nbsp;</P>\r\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: Tahoma; mso-bidi-font-size: 12.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN><STRONG>2009<BR></STRONG>Klanen mister endnu&nbsp;et elsket og dyrebart medlem, Ole.<BR></P>',32,0,6,0,'2009-07-06 13:15:21','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Klanen','112');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (235,'rynkeby','<P><FONT size=5><STRONG>Historien om en entusiast<BR></STRONG><FONT size=3>&nbsp;</FONT><BR></FONT></P>\r\n<P><FONT size=3>Fredag d. 17/7. 105 km. til Vordingborg kasserne. Mødetid 08.00, aflevering af kuffert og morgenmønstring(ja, holdkaptainen er Oberst). Morgenmad og halløj på Rådhuspladsen fra 9-11. Det var hyggeligt med familie og venner, men føj for noget musik. Afgang kl 11.30(ca.) mod Rigshospitalet. Aflevering af gave og bamser til kræftramte børn og tale ved bla. sundhedsminister. Det var dejligt at se at børnene blev glade, men jeg tror ikke at de helt forstod hvad der foregik. Afgang kl. 12 mod Ishøj Golfklub hvor forkosten blev indtaget. Det var kanon at køre gennem København med politi eskorte.... Bare køre over for alle røde lys, mens billisterne måtte holde tilbage. Efter frokost videre mod Vordingborg (stadivæk med politi eskorte, YES !). Vi nåede lige forbi TV2 Øst og til Kassernen før det begyndte at regne. Desværre lyder vejrudsigten ikke for god for imorgen :-(. Men nu må vi se hvad der sker. Forløbig er hummøret højt.</FONT></P>\r\n<P><FONT size=3>&nbsp;</FONT></P>\r\n<P><FONT size=5></FONT>&nbsp;</P>\r\n<P><FONT size=5>Yes sir! Så er grejet ankommet. </FONT></P>\r\n<P><FONT size=5>&nbsp;<IMG style=\"WIDTH: 439px; HEIGHT: 328px\" height=1380 alt=\"Cykel samlet\" hspace=0 src=\"http://www.traekmigikaelken.dk/upload/uploads/Rynke1.JPG\" width=1744 align=baseline border=0></FONT></P>\r\n<P><FONT size=5>Bemærk sadlen... ikke ligefrem mormor modelen. Det kommer&nbsp;til at gøre mega nas i ******</FONT></P>\r\n<P><FONT size=5>Her er ruten, hvis der er en som mangler et tur forslag</FONT></P>\r\n<P><FONT size=5><IMG style=\"WIDTH: 464px; HEIGHT: 283px\" height=221 alt=\"\" hspace=0 src=\"http://www.traekmigikaelken.dk/upload/uploads/TeamRynkeby-Rute.bmp\" width=327 align=baseline border=0></FONT></P>\r\n<P><FONT size=5>Trænings plan fra en MEGET optimistisk hold kaptajn:</FONT></P><FONT size=5>\r\n<P>\r\n<TABLE style=\"WIDTH: 408pt; BORDER-COLLAPSE: collapse\" cellSpacing=0 cellPadding=0 width=543 border=0 x:str>\r\n<COLGROUP>\r\n<COL style=\"WIDTH: 43pt; mso-width-source: userset; mso-width-alt: 2084\" width=57>\r\n<COL style=\"WIDTH: 38pt; mso-width-source: userset; mso-width-alt: 1828\" width=50>\r\n<COL style=\"WIDTH: 27pt; mso-width-source: userset; mso-width-alt: 1316\" width=36>\r\n<COL style=\"WIDTH: 31pt; mso-width-source: userset; mso-width-alt: 1499\" width=41>\r\n<COL style=\"WIDTH: 240pt; mso-width-source: userset; mso-width-alt: 11702\" width=320>\r\n<COL style=\"WIDTH: 29pt; mso-width-source: userset; mso-width-alt: 1426\" width=39>\r\n<TBODY>\r\n<TR style=\"HEIGHT: 15pt\" height=20>\r\n<TD class=xl63 style=\"BORDER-RIGHT: #f0f0f0; BORDER-TOP: #f0f0f0; BORDER-LEFT: #f0f0f0; WIDTH: 43pt; BORDER-BOTTOM: #f0f0f0; HEIGHT: 15pt; BACKGROUND-COLOR: yellow\" width=57 height=20><STRONG><FONT face=Arial>Nr.:</FONT></STRONG></TD>\r\n<TD class=xl79 style=\"BORDER-RIGHT: #f0f0f0; BORDER-TOP: #f0f0f0; BORDER-LEFT: #f0f0f0; WIDTH: 38pt; BORDER-BOTTOM: #f0f0f0; BACKGROUND-COLOR: yellow\" width=50><STRONG><FONT face=Arial>Dato:</FONT></STRONG></TD>\r\n<TD class=xl63 style=\"BORDER-RIGHT: #f0f0f0; BORDER-TOP: #f0f0f0; BORDER-LEFT: #f0f0f0; WIDTH: 27pt; BORDER-BOTTOM: #f0f0f0; BACKGROUND-COLOR: yellow\" width=36><STRONG><FONT face=Arial>Dag:</FONT></STRONG></TD>\r\n<TD class=xl63 style=\"BORDER-RIGHT: #f0f0f0; BORDER-TOP: #f0f0f0; BORDER-LEFT: #f0f0f0; WIDTH: 31pt; BORDER-BOTTOM: #f0f0f0; BACKGROUND-COLOR: yellow\" width=41><STRONG><FONT face=Arial>Tid:</FONT></STRONG></TD>\r\n<TD class=xl63 style=\"BORDER-RIGHT: #f0f0f0; BORDER-TOP: #f0f0f0; BORDER-LEFT: #f0f0f0; WIDTH: 240pt; BORDER-BOTTOM: #f0f0f0; BACKGROUND-COLOR: yellow\" width=320><STRONG><FONT face=Arial>Arrangement/Sted:</FONT></STRONG></TD>\r\n<TD class=xl63 style=\"BORDER-RIGHT: