nt\"><FONT face=Calibri size=3></FONT></TD>\r\n<TD class=xl77 style=\"BORDER-RIGHT: #f0f0f0; BORDER-TOP: windowtext 0.5pt solid; BORDER-LEFT: #f0f0f0; BORDER-BOTTOM: windowtext 2pt double; BACKGROUND-COLOR: transparent\" align=right x:num=\"3217\" x:fmla=\"=SUM(F2:F41)\"><STRONG><FONT face=Arial>3.217</FONT></STRONG></TD></TR></TBODY></TABLE></P>\r\n<P>Trænings log:</P>\r\n<P></FONT><FONT size=3>Total km:&nbsp;1202&nbsp;&nbsp; Total tid: 49:19</FONT></P>\r\n<P><FONT size=3>Søndag d. 22/2&nbsp; 2x30 min. Av min røv</FONT></P>\r\n<P><FONT size=3>Mandag d. 23/2 1 time. Røven sagde av de første 20 min. Højre fod lidt øm.</FONT></P>\r\n<P><FONT size=3>Onsdag d. 25/2 1½ time. Røven sagde av de første 5 min. </FONT></P>\r\n<P><FONT size=3>Torsdag d. 26/2 1½ time. Røven ok, højre fod sov lidt, svedte som et svin.</FONT></P>\r\n<P><FONT size=3>Søndag d. 1/3 30km. Røven ok, fod ok. Rimlig hårdt oven på druk weekend :-(</FONT></P>\r\n<P><FONT size=3>Tirsdag d. 3/3 43km. 1t&amp;50 min. Fælles træning. Væltede efter ca. 30m lol. Lorte bakker.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 7/3 41km. 1t&amp;41 min. Fælles træning. Ok tur, koldt langs strandvejen.</FONT></P>\r\n<P><FONT size=3>Tirsdag&nbsp;d. 10/3 1½ time. Rimlig trist at træne indendørs :-(</FONT></P>\r\n<P><FONT size=3>Lørdag d. 14/3 52km 2t&amp;16 min træning. God tur, lidt øm i lænden/ballerne.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 21/3 65km 2t41 min. Fælles træning. Rigtig god tur, overskud til slutspurt :-)</FONT></P>\r\n<P><FONT size=3>Søndag d. 29/3 80km 3t&amp;27 min. Fælles træning, Ok tur, trist gennem KBH, godt ved Hvidovre og Amager. Kræfter til spurt.</FONT></P>\r\n<P><FONT size=3>Tirsdag d. 31/3 53km 2t03 min. Fælles træning, ok tur, kunne godt mærke søndagens tur i benene.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 4/4 75km 2t52 min. Fælles træning. Ok tur. Havde lidt ondt i højre knæ i starten.</FONT></P>\r\n<P><FONT size=3>Fredag d. 10/4 100,6 km 3t57min. Fælles træning. Rigtig god tur, se bare her: <SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><A href=\"http://www.gmap-pedometer.com/?r=2679318\" target=_blank><SPAN style=\"COLOR: #0068cf\"><U>http://www.gmap-pedometer.com/?r=2679318</U></SPAN></A>. <FONT size=3>Kørte lidt extra så jeg rundede de 100 km</FONT>. </SPAN></FONT></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d.12/4 93km 3t40min. Fælles træning i Korsør. Lidt ondt i røv, men ellers ok tur.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>En lille pause periode grundet knæskade. MR scanning siger minisk skade. Ved kikkert operation er der heldigvis kun små bruskskader. Må gerne cykle igen.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Fredag d. 8/5 40km 1t10min træning med Steen&nbsp;i Roskilde området. Første længere tur efter knæ operationen. Fin tur, temmelig meget mod vind.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Lørdag d. 9/5 25km 1t træning allene i Ballerup. Skulle lige ud og se om knæeet holdt. Det gjorde det.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d. 10/5 63km 2t28min træning med Wium. God tur til Klampenborg, Nærum, Farum og hjem.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Tirsdag d. 12/5 70km træning med TRV holdet. Rigtig god tur.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Torsdag d. 14/5 50km træning med nogle fra TRV holdet i Roskilde omegen.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d. 17/5 145km Skjoldnæsholmløbet. Rigtig god tur fra Roskilde og vest på. Er pænt træt i hele kroppen og vil bare gerne i seng og sove...</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Søndag d. 24/5. 110km køretid 4t41min totaltid 7,5time. Regnvejrs tur, 15 punkteringer alt i alt. Pænt trist.</FONT></SPAN></P>\r\n<P><SPAN style=\"FONT-SIZE: 10pt; FONT-FAMILY: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><FONT size=3>Tirsdag d. 26/5. 71km. Fed tur fra Albertslund mod Hove, Ganløse og videre. Hjem via Trekroner...</FONT></SPAN></P>\r\n<P><FONT size=3>Lørdag d. 30/5 120km. Tur rundt i på Møn fra Langebæk</FONT></P>\r\n<P><FONT size=3>Lørdag d. 6/6 100km. Søsletteløbet fra Ringe på Fyn. </FONT></P>\r\n<P><FONT size=3>Søndag d. 7/6 70km på Hallandsåsen i Sverige. De har bakker der vil noget :-)</FONT></P>\r\n<P><FONT size=3>Søndag d. 14/6 185km.&nbsp;Lige over 7 timer. Vordingborg&nbsp;-&gt; Præstø -&gt; Stege -&gt; Vordingborg. Lang tur, men go træning.</FONT></P>\r\n<P><FONT size=3>Søndag d. 21/6 160km. Tur til sommerhus i Sverige. Stille og rolig tur grundet de mange pauser</FONT></P>\r\n<P><FONT size=3>Mandag d. 22/6 75km. Fin tur med start fra Albertslund. Kun 13 deltagere... sikkert på grund af trænings turen søndag.</FONT></P>\r\n<P><FONT size=3>Lørdag d. 27/6 200km. YES !!! Det lykkedes at runde 200km på 1 dag. Totalt optur...</FONT></P>\r\n<P><FONT size=3>Søndag d. 28/6 160km. Stille og rolig tur oven på de 200 km i går. Ingen problemer med røv eller føder.</FONT></P>\r\n<P><FONT size=3>Tirsdag d. 14/7.... Forventer jeg at køre 75km. Sidste trænngs samling før det går mod Paris d. 17...</FONT></P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>\r\n<P><FONT size=3></FONT>&nbsp;</P>',50,0,7,0,'2009-07-24 19:28:39','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Rynkeby','106');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (242,'forside','<P><FONT size=5><STRONG>Forside</STRONG></FONT></P>\r\n<P><FONT size=2>Så er årets skitur arrangeret! Den gode radiosnitter tog et godt initiativ og fik endelig indkaldt til \"afterskir\" ?!?!?<BR>Turen går i år til <STRONG>Åre</STRONG> med tog :) NICE</FONT></P>\r\n<P><FONT size=2>Tjek lige mit server termometer ud .. nu kan i se om den har feber :) <A href=\"http://www.traekmigikaelken.dk/?#tempskema\">LINK</A></FONT></P>',15,0,6,0,'2009-10-03 19:32:32','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Forsiden','101');
INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (243,'skitur','<P><FONT size=5><STRONG>SKITUR 2010</STRONG></FONT></P>\r\n<P>Skituren går i år til Åre!<BR></P>\r\n<P><FONT size=5><STRONG>SKITUR 2009</STRONG></FONT></P>\r\n<P>Skituren går i år til Trysil i Norge! <A href=\"http://www.skistar.com/trysil/norsk/skikjoring/index.app\">TRYSIL INFO</A><BR>Til trods for vores mange overvejelser omkring transporten er det en merudgift på næsten 6000 for rejsen hvis vi IKKE kører selv så det er besluttet i 12. time at vi kører selv.<BR>Bo og Wium har indtilvidere meldt ud at vi godt kan bruge deres køretøjer.</P>\r\n<P>Ankomst: Søndag&nbsp;d. 15.03.2009<BR>Afrejse: Torsdag d. 19.03.2009</P>\r\n<P>Økonomi:<BR>HUS&nbsp; :&nbsp; 5800 (inkusiv tvungen&nbsp;slutrengøring)<BR>KØRETUR : 7400 (2 x 3700)<BR>MAD og div: Max 2600</P>\r\n<P>Pr Person : 2600<BR>Liftkort : 930 (3 dage)</P>\r\n<P>Ialt : 3530 ALT INKL :)<BR></P>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0 width=\"100%\">\r\n<TBODY>\r\n<TR vAlign=top align=left>\r\n<TD colSpan=6>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0 width=\"100%\">\r\n<TBODY>\r\n<TR>\r\n<TD noWrap>\r\n<P><STRONG>Trysil Turistsenter | Skitorget</STRONG> </P></TD>\r\n<TD vAlign=top width=10 align=left><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=10 height=10> </TD>\r\n<TD width=\"100%\"></TD>\r\n<TD noWrap><IMG border=0 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=17 height=16> <IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=9 height=10> <IMG border=0 src=\"https://www.skistar.com/app/projects/common/images/system/boende/icon_large_cigarette.gif\"> </TD></TR>\r\n<TR>\r\n<TD class=svart11pt colSpan=4>Leilighet, 63 m², 2 soverom, 6 senger, 1 bad, byggeår 1990/2006. Sengekombinasjon (D)+(K+K)Forklaring på sengekombinasjon: D = dobbeltseng, E = enkeltseng, K = køyeseng, KB = køyeseng med bred underkøye (tallet bak KB angir bredden på underkøyen)Bad 1 med dusj, WC og badstu. Enheten har oppvaskmaskin, mikrobølgeovn, kjøleskap l, fryser l. Denne leiligheten formidles på vegne av Trysil ResortRøyking ikke tillatt </TD></TR></TBODY></TABLE></TD>\r\n<TD>&nbsp;</TD>\r\n<TD vAlign=bottom align=right>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR vAlign=top align=left>\r\n<TD bgColor=#99cce6 colSpan=3><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=16 height=1></TD></TR>\r\n<TR vAlign=top align=left>\r\n<TD bgColor=#99cce6 width=1><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=1 height=15></TD>\r\n<TD>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR vAlign=top align=left bgColor=#ffffff>\r\n<TD colSpan=3><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=16 height=1></TD></TR>\r\n<TR vAlign=top align=left>\r\n<TD bgColor=#ffffff width=1><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=1 height=15></TD>\r\n<TD>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR>\r\n<TD>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR>\r\n<TD bgColor=#ffffff><A href=\"javascript: showMoreImages(\'TTUST01\',\'pool\',22866);\"><IMG border=0 src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=22866&amp;x=160\"></A></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE><IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=22866&amp;y=300\"> <IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=14447&amp;y=300\"> <IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=14443&amp;y=300\">&nbsp; \r\n<P><FONT size=5><STRONG></STRONG></FONT>&nbsp;</P>\r\n<P><FONT size=5><STRONG>SKITUR 2008</STRONG></FONT></P>\r\n<P><FONT size=2>Turen gik i år til Norge. Hemsedal for at være helt præcis. Vi havde lånt en Ford transit af Claus, som var årets \"nye\" mand, så vi kunne køre samlet i et køretøj. Det var super hyggeligt. 4 så film imens driver og co-driver ordende kørslen.</FONT></P>\r\n<P><FONT size=2>Hytten var af luksusklassen og plads var der rigeligt af. 5 soveværelser til 6 mand giver hygge for to ;)</FONT></P>\r\n<P><FONT size=2>Pistene var lidt længere væk end vi havde regnet med, men det gjorde ikke det store, for kvaliteten af pisterne kompenserede mere end rigeligt for den ekstra køretid - det var super fedt terræn, både on og off piste. <BR>Jeg vil gerne i den anledning sende de varmeste hilsener til bo, som viste os flere sider af den skønne Norske natur end vi havde kunnet ønske os. (Eller frygte vil nogen nok mene!) Claus takker for de trykkede ribben!</FONT></P>\r\n<P><FONT size=2>Se flere billeder under [billeder] og vælg galleriet [Skitur 2008]</FONT></P>\r\n<P>&nbsp;<IMG border=0 hspace=0 alt=Hytte align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image006.jpg\" width=118 height=98>&nbsp;<IMG style=\"WIDTH: 134px; HEIGHT: 109px\" border=0 hspace=0 alt=Grundplan align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image008.jpg\" width=128 height=99>&nbsp;<IMG border=0 hspace=0 alt=Sofagruppen align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image009.jpg\" width=129 height=99>&nbsp;<IMG border=0 hspace=0 alt=Køkken align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image012.jpg\" width=118 height=98></P></FONT>\r\n<P><STRONG><FONT size=5>SKITUR 2007</FONT></STRONG></P>\r\n<P>Turen var et Kæmpe hit. Ikke mindst fordi vi fik Pizza TorTur til daglig ;)</P>\r\n<P><FONT size=3><STRONG>SÅ ER DER VIDEO FRA TUREN<BR></STRONG></FONT><FONT size=2><A href=\"http://www.traekmigikaelken.dk/upload/uploads/klan2007_0001.wmv\">Hent den her</A></FONT></P>\r\n<P><STRONG><FONT size=3>Sälen greatest 2007 05<BR></FONT></STRONG><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Rasmus%20Nøhr%20ft.%20Ida%20Corr%20-%20Det%20Glade%20Pizzabud.mp3\">Rasmus Nøhr ft. Ida Corr - Det Glade Pizzabud</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Karina%20Kappel%20Remix%20Twisted%20Cinderella.mp3\">Karina Kappel Remix - Twisted Cinderella</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/ACDC%20-%20You%20Shook%20Me%20Up%20All%20Night%20Long.mp3\">ACDC - You Shook Me Up All Night Long</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/ACDC,Bon%20Jovi,Metallica,Nirvana,Guns%20And%20Roses%20-%20She%20Shook%20Me%20All%20Night%20Long.mp3\">ACDC,Bon Jovi,Metallica,Nirvana,Guns And Roses - She Shook Me All Night Long</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Ufo%20og%20Yepha%20-%20Op%20med%20håret.mp3\">Ufo og Yepha - Op med håret</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Ufo%20Yepa%20Bli%20Glad%20&amp;%20Natasja%20-%20Hængekøjen%20remix.mp3\">UFO &amp; Yepha Feat. Bli\' Glad &amp; Natasja - Hængekøjen remix</A></P>\r\n<TABLE border=0 width=\"100%\">\r\n<TBODY>\r\n<TR>\r\n<TD width=\"50%\" align=middle>\r\n<P>SÄLEN INFO</P>\r\n<P>Nyttige links: <BR><A href=\"http://www.skistar.com/salen/svenska/skidakning/pistkartor/index.app\">Pistekort</A><BR><A href=\"http://www.skistar.com/salen/svenska/skidakning/oppna_pister__liftar/index.app\">Piste info</A></P></TD>\r\n<TD>\r\n<P align=right><IMG border=0 hspace=0 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/skibake%201.jpg\"></P></TD></TR></TBODY></TABLE>\r\n<P>&nbsp;</P>\r\n<P>Sådan så hytten ud ... inden vi havde trashet den! (klik for store billeder)</P>\r\n<P>&nbsp;<A href=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_01.jpg\"><IMG border=0 hspace=10 alt=H