INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (247,'skitur','<P><FONT size=5><STRONG>SKITUR 2010</STRONG></FONT></P>\r\n<P>Skituren går i år til Åre!<BR>Se en kort intro til Åre <A href=\"http://www.skistar.com/are/svenska/misc/are_webbtv.app\">her</A></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Arial\',\'sans-serif\'; COLOR: black; FONT-SIZE: 12pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><STRONG>Åre By | Liengården 503</STRONG></SPAN><SPAN style=\"FONT-FAMILY: \'Arial\',\'sans-serif\'; COLOR: black; FONT-SIZE: 8.5pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"> <BR></SPAN><SPAN style=\"FONT-FAMILY: \'Arial\',\'sans-serif\'; COLOR: black; FONT-SIZE: 8.5pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN><FONT size=2>Hytten/Lejligheden ligger i/ved Liengården 503, Rækkehuslejlighederne er 95 kvm, i to etager, med 4 soveværelser.&nbsp;Allrum med køkkenafdeling. Køkkenet indeholder:opvaskemaskine, elkomfur med ovn, køleskab med fryser, microbølgeovn.&nbsp;Soveværelse-1 = 2 enkeltseng(e). Soveværelse-2 = 2 enkeltseng(e). Soveværelse-3 = 1 køjeseng(e). Soveværelse-4 = 1 dobbeltseng(e). Badeværelset-1 = brus/wc/sauna. Badeværelset-2 = wc.&nbsp;I Øvrigt findes: Balkon, farve TV/kabel, tørreskab, Max antal personer er 8 i denne lejlighed/hytte.&nbsp;Observer at rygning ikke er tilladt i vore lejligheder, Ikke tilladt at modtage husdyr.&nbsp;Sengelinned og slutrengøring indgår ikke medmindre det er forudbestilt. <BR></FONT></P>\r\n<P><FONT size=2><IMG border=0 hspace=0 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/skitur2010_01.jpg\">&nbsp;<IMG border=0 hspace=0 alt=\"placering af hytten\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/skitur2010_02.jpg\"></P></FONT>\r\n<P><FONT size=5><STRONG></STRONG></FONT>&nbsp;</P>\r\n<P><FONT size=5><STRONG></STRONG></FONT>&nbsp;</P>\r\n<P><FONT size=5><STRONG>SKITUR 2009</STRONG></FONT></P>\r\n<P>Skituren går i år til Trysil i Norge! <A href=\"http://www.skistar.com/trysil/norsk/skikjoring/index.app\">TRYSIL INFO</A><BR>Til trods for vores mange overvejelser omkring transporten er det en merudgift på næsten 6000 for rejsen hvis vi IKKE kører selv så det er besluttet i 12. time at vi kører selv.<BR>Bo og Wium har indtilvidere meldt ud at vi godt kan bruge deres køretøjer.</P>\r\n<P>Ankomst: Søndag&nbsp;d. 15.03.2009<BR>Afrejse: Torsdag d. 19.03.2009</P>\r\n<P>Økonomi:<BR>HUS&nbsp; :&nbsp; 5800 (inkusiv tvungen&nbsp;slutrengøring)<BR>KØRETUR : 7400 (2 x 3700)<BR>MAD og div: Max 2600</P>\r\n<P>Pr Person : 2600<BR>Liftkort : 930 (3 dage)</P>\r\n<P>Ialt : 3530 ALT INKL :)<BR></P>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0 width=\"100%\">\r\n<TBODY>\r\n<TR vAlign=top align=left>\r\n<TD colSpan=6>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0 width=\"100%\">\r\n<TBODY>\r\n<TR>\r\n<TD noWrap>\r\n<P><STRONG>Trysil Turistsenter | Skitorget</STRONG> </P></TD>\r\n<TD vAlign=top width=10 align=left><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=10 height=10> </TD>\r\n<TD width=\"100%\"></TD>\r\n<TD noWrap><IMG border=0 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=17 height=16> <IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=9 height=10> <IMG border=0 src=\"https://www.skistar.com/app/projects/common/images/system/boende/icon_large_cigarette.gif\"> </TD></TR>\r\n<TR>\r\n<TD class=svart11pt colSpan=4>Leilighet, 63 m², 2 soverom, 6 senger, 1 bad, byggeår 1990/2006. Sengekombinasjon (D)+(K+K)Forklaring på sengekombinasjon: D = dobbeltseng, E = enkeltseng, K = køyeseng, KB = køyeseng med bred underkøye (tallet bak KB angir bredden på underkøyen)Bad 1 med dusj, WC og badstu. Enheten har oppvaskmaskin, mikrobølgeovn, kjøleskap l, fryser l. Denne leiligheten formidles på vegne av Trysil ResortRøyking ikke tillatt </TD></TR></TBODY></TABLE></TD>\r\n<TD>&nbsp;</TD>\r\n<TD vAlign=bottom align=right>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR vAlign=top align=left>\r\n<TD bgColor=#99cce6 colSpan=3><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=16 height=1></TD></TR>\r\n<TR vAlign=top align=left>\r\n<TD bgColor=#99cce6 width=1><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=1 height=15></TD>\r\n<TD>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR vAlign=top align=left bgColor=#ffffff>\r\n<TD colSpan=3><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=16 height=1></TD></TR>\r\n<TR vAlign=top align=left>\r\n<TD bgColor=#ffffff width=1><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=1 height=15></TD>\r\n<TD>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR>\r\n<TD>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0>\r\n<TBODY>\r\n<TR>\r\n<TD bgColor=#ffffff><A href=\"javascript: showMoreImages(\'TTUST01\',\'pool\',22866);\"><IMG border=0 src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=22866&amp;x=160\"></A></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE><IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=22866&amp;y=300\"> <IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=14447&amp;y=300\"> <IMG src=\"https://www.skistar.com/app/modules/imlib/fetchimage.php?app=88&amp;id=14443&amp;y=300\">&nbsp; \r\n<P><FONT size=5><STRONG></STRONG></FONT>&nbsp;</P>\r\n<P><FONT size=5><STRONG>SKITUR 2008</STRONG></FONT></P>\r\n<P><FONT size=2>Turen gik i år til Norge. Hemsedal for at være helt præcis. Vi havde lånt en Ford transit af Claus, som var årets \"nye\" mand, så vi kunne køre samlet i et køretøj. Det var super hyggeligt. 4 så film imens driver og co-driver ordende kørslen.</FONT></P>\r\n<P><FONT size=2>Hytten var af luksusklassen og plads var der rigeligt af. 5 soveværelser til 6 mand giver hygge for to ;)</FONT></P>\r\n<P><FONT size=2>Pistene var lidt længere væk end vi havde regnet med, men det gjorde ikke det store, for kvaliteten af pisterne kompenserede mere end rigeligt for den ekstra køretid - det var super fedt terræn, både on og off piste. <BR>Jeg vil gerne i den anledning sende de varmeste hilsener til bo, som viste os flere sider af den skønne Norske natur end vi havde kunnet ønske os. (Eller frygte vil nogen nok mene!) Claus takker for de trykkede ribben!</FONT></P>\r\n<P><FONT size=2>Se flere billeder under [billeder] og vælg galleriet [Skitur 2008]</FONT></P>\r\n<P>&nbsp;<IMG border=0 hspace=0 alt=Hytte align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image006.jpg\" width=118 height=98>&nbsp;<IMG style=\"WIDTH: 134px; HEIGHT: 109px\" border=0 hspace=0 alt=Grundplan align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image008.jpg\" width=128 height=99>&nbsp;<IMG border=0 hspace=0 alt=Sofagruppen align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image009.jpg\" width=129 height=99>&nbsp;<IMG border=0 hspace=0 alt=Køkken align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/image012.jpg\" width=118 height=98></P></FONT>\r\n<P><STRONG><FONT size=5>SKITUR 2007</FONT></STRONG></P>\r\n<P>Turen var et Kæmpe hit. Ikke mindst fordi vi fik Pizza TorTur til daglig ;)</P>\r\n<P><FONT size=3><STRONG>SÅ ER DER VIDEO FRA TUREN<BR></STRONG></FONT><FONT size=2><A href=\"http://www.traekmigikaelken.dk/upload/uploads/klan2007_0001.wmv\">Hent den her</A></FONT></P>\r\n<P><STRONG><FONT size=3>Sälen greatest 2007 05<BR></FONT></STRONG><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Rasmus%20Nøhr%20ft.%20Ida%20Corr%20-%20Det%20Glade%20Pizzabud.mp3\">Rasmus Nøhr ft. Ida Corr - Det Glade Pizzabud</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Karina%20Kappel%20Remix%20Twisted%20Cinderella.mp3\">Karina Kappel Remix - Twisted Cinderella</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/ACDC%20-%20You%20Shook%20Me%20Up%20All%20Night%20Long.mp3\">ACDC - You Shook Me Up All Night Long</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/ACDC,Bon%20Jovi,Metallica,Nirvana,Guns%20And%20Roses%20-%20She%20Shook%20Me%20All%20Night%20Long.mp3\">ACDC,Bon Jovi,Metallica,Nirvana,Guns And Roses - She Shook Me All Night Long</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Ufo%20og%20Yepha%20-%20Op%20med%20håret.mp3\">Ufo og Yepha - Op med håret</A><BR><A href=\"http://www.traekmigikaelken.dk/upload/uploads/Ufo%20Yepa%20Bli%20Glad%20&amp;%20Natasja%20-%20Hængekøjen%20remix.mp3\">UFO &amp; Yepha Feat. Bli\' Glad &amp; Natasja - Hængekøjen remix</A></P>\r\n<TABLE border=0 width=\"100%\">\r\n<TBODY>\r\n<TR>\r\n<TD width=\"50%\" align=middle>\r\n<P>SÄLEN INFO</P>\r\n<P>Nyttige links: <BR><A href=\"http://www.skistar.com/salen/svenska/skidakning/pistkartor/index.app\">Pistekort</A><BR><A href=\"http://www.skistar.com/salen/svenska/skidakning/oppna_pister__liftar/index.app\">Piste info</A></P></TD>\r\n<TD>\r\n<P align=right><IMG border=0 hspace=0 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/skibake%201.jpg\"></P></TD></TR></TBODY></TABLE>\r\n<P>&nbsp;</P>\r\n<P>Sådan så hytten ud ... inden vi havde trashet den! (klik for store billeder)</P>\r\n<P>&nbsp;<A href=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_01.jpg\"><IMG border=0 hspace=10 alt=Hytten align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_01.jpg\" width=100></A><A href=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_02.jpg\"><IMG border=0 hspace=10 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_02.jpg\" width=100></A><A href=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_03.jpg\"><IMG border=0 hspace=10 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/hytte_03.jpg\" width=100></A></P>\r\n<P>&nbsp;</P>',30,0,6,0,'2009-11-13 22:06:41','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'','Skitur','104');
