INSERT INTO `` (`id`,`navn`,`tekst`,`version`,`userchange`,`useropret`,`userslet`,`oprettet`,`changed`,`slettet`,`aktiv`,`kommentar`,`menunavn`,`menulink`) VALUES (249,'skitur','<P><FONT size=5><STRONG>SKITUR 2010</STRONG></FONT></P>\r\n<P>Skituren går i år til Åre!<BR>Se en kort intro til Åre <A href=\"http://www.skistar.com/are/svenska/misc/are_webbtv.app\">her</A></P>\r\n<P><A href=\"http://www.skistar.com/app/projects/are/images/imlib/Pistkarta_2009_low\">pistkort</A></P>\r\n<P><SPAN style=\"FONT-FAMILY: \'Arial\',\'sans-serif\'; COLOR: black; FONT-SIZE: 12pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"><STRONG>Åre By | Liengården 503</STRONG></SPAN><SPAN style=\"FONT-FAMILY: \'Arial\',\'sans-serif\'; COLOR: black; FONT-SIZE: 8.5pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"> <BR></SPAN><SPAN style=\"FONT-FAMILY: \'Arial\',\'sans-serif\'; COLOR: black; FONT-SIZE: 8.5pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: DA; mso-fareast-language: DA; mso-bidi-language: AR-SA\"></SPAN><FONT size=2>Hytten/Lejligheden ligger i/ved Liengården 503, Rækkehuslejlighederne er 95 kvm, i to etager, med 4 soveværelser.&nbsp;Allrum med køkkenafdeling. Køkkenet indeholder:opvaskemaskine, elkomfur med ovn, køleskab med fryser, microbølgeovn.&nbsp;Soveværelse-1 = 2 enkeltseng(e). Soveværelse-2 = 2 enkeltseng(e). Soveværelse-3 = 1 køjeseng(e). Soveværelse-4 = 1 dobbeltseng(e). Badeværelset-1 = brus/wc/sauna. Badeværelset-2 = wc.&nbsp;I Øvrigt findes: Balkon, farve TV/kabel, tørreskab, Max antal personer er 8 i denne lejlighed/hytte.&nbsp;Observer at rygning ikke er tilladt i vore lejligheder, Ikke tilladt at modtage husdyr.&nbsp;Sengelinned og slutrengøring indgår ikke medmindre det er forudbestilt. <BR></FONT></P>\r\n<P><FONT size=2><IMG border=0 hspace=0 alt=\"\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/skitur2010_01.jpg\">&nbsp;</FONT></P>\r\n<P><FONT size=2><IMG border=0 hspace=0 alt=\"placering af hytten\" align=baseline src=\"http://www.traekmigikaelken.dk/upload/uploads/skitur2010_02.jpg\"></P></FONT>\r\n<P><FONT size=5><STRONG></STRONG></FONT>&nbsp;</P>\r\n<P><FONT size=5><STRONG></STRONG></FONT>&nbsp;</P>\r\n<P><FONT size=5><STRONG>SKITUR 2009</STRONG></FONT></P>\r\n<P>Skituren går i år til Trysil i Norge! <A href=\"http://www.skistar.com/trysil/norsk/skikjoring/index.app\">TRYSIL INFO</A><BR>Til trods for vores mange overvejelser omkring transporten er det en merudgift på næsten 6000 for rejsen hvis vi IKKE kører selv så det er besluttet i 12. time at vi kører selv.<BR>Bo og Wium har indtilvidere meldt ud at vi godt kan bruge deres køretøjer.</P>\r\n<P>Ankomst: Søndag&nbsp;d. 15.03.2009<BR>Afrejse: Torsdag d. 19.03.2009</P>\r\n<P>Økonomi:<BR>HUS&nbsp; :&nbsp; 5800 (inkusiv tvungen&nbsp;slutrengøring)<BR>KØRETUR : 7400 (2 x 3700)<BR>MAD og div: Max 2600</P>\r\n<P>Pr Person : 2600<BR>Liftkort : 930 (3 dage)</P>\r\n<P>Ialt : 3530 ALT INKL :)<BR></P>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0 width=\"100%\">\r\n<TBODY>\r\n<TR vAlign=top align=left>\r\n<TD colSpan=6>\r\n<TABLE border=0 cellSpacing=0 cellPadding=0 width=\"100%\">\r\n<TBODY>\r\n<TR>\r\n<TD noWrap>\r\n<P><STRONG>Trysil Turistsenter | Skitorget</STRONG> </P></TD>\r\n<TD vAlign=top width=10 align=left><IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=10 height=10> </TD>\r\n<TD width=\"100%\"></TD>\r\n<TD noWrap><IMG border=0 src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=17 height=16> <IMG src=\"https://www.skistar.com/app/projects/common/images/system/delat/pixel_blank.gif\" width=9 height=10> <IMG border=0 src=\"https://www.skistar.com/app/projects/common/images/system/boende/icon_large_cigarette.gif\"> </